import React,{Component} from 'react';
import './TodoList.css';

class TodoList extends Component{
    render(){
        var class1 ='';
        if(this.props.name.delete === true)
        {
            class1 = 'delete';
        }else{
            class1 = '';
        }
        return <tr className={class1} onClick={this.props.delete}>
            <th scope="row">{this.props.stt+1}</th>
            <td>{this.props.name.detail}</td>
            <td>{this.props.name.time}</td>
            <td>{this.props.name.status}</td>
            <img src={this.props.url}  />
        </tr>
    }
}

export default TodoList;
